import React, { Component } from "react";
import history from "../routes/history";

class Navbar extends Component {
  changeRoute(route) {
    history.push(route);
    console.log("dd");
  }

  render() {
    return (
      <div class="navbar">
        <span class="col-1"> Logo </span>
        <div class="col-2">
          <button onClick={() => this.changeRoute("register")}>
            Register
          </button>
          <button onClick={() => this.changeRoute("login")}> Login </button>
        </div>
      </div>
    );
  }
}

Navbar.propTypes = {};

export default Navbar;
